The official mobile application of Bansko Ski Zone brings up to date information for the ski resort.
You will have  on finger distance information about:
- information about weather and ski conditions;
- information about working lifts and slopes;
- purchase ski-passes
- view history of ski-pass purchases
- view ski-pass usage statistics
- detailed weather forecast;
- map of the ski area;
- panorama camera snapshots;
- complete address book of all facilities, services and restaurants available in Bansko Ski Zone;
- emergency phone numbers and information.

Ski-pass related features require signing up and providing personal data (name and date of birth). These are required for a valid with ski-pass insurance policy

Card payment process is compliant with EMV 3DSv2 standard and fulfill EU directive 2015/2366 and 2018/389

